import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from './components/Header';
import HomePage from './components/HomePage';
import FashionPage from './components/FashionPage';
import BeautyPage from './components/BeautyPage';
import LifestylePage from './components/LifestylePage';
import FashionPostPage from './components/FashionPostPage';
import BeautyPostPage from './components/BeautyPostPage';
import LifestylePostPage from './components/LifestylePostPage';
import AddNewPostPage from './components/AddNewPostPage'; // Import the AddNewPostPage component

const App = () => {
  return (
    <Router>
      <div>
        <Header />
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/fashion" element={<FashionPage />} />
          <Route path="/beauty" element={<BeautyPage />} />
          <Route path="/lifestyle" element={<LifestylePage />} />
          <Route path="/fashion/:postId" element={<FashionPostPage />} />
          <Route path="/beauty/:postId" element={<BeautyPostPage />} />
          <Route path="/lifestyle/:postId" element={<LifestylePostPage />} />
          <Route path="/add-new-post" element={<AddNewPostPage />} /> {/* Add the route for the AddNewPostPage */}
        </Routes>
      </div>
    </Router>
  );
};

export default App;
